import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import Typography from '@material-ui/core/Typography';
import Icon from '@material-ui/core/Icon';
import Input from '@material-ui/core/Input';
import InputLabel from '@material-ui/core/InputLabel';
import InputAdornment from '@material-ui/core/InputAdornment';
import FormControl from '@material-ui/core/FormControl'; 
import Select from '@material-ui/core/Select';
import Button from '@material-ui/core/Button';

//import TextField from '@material-ui/core/TextField';
//import MenuItem from '@material-ui/core/MenuItem';
/* import Grid from '@material-ui/core/Grid'; */
/* import AccountCircle from '@material-ui/icons/AccountCircle'; */

const useStyles = makeStyles((theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '50ch',
    },
  },
  margin: {
    margin: theme.spacing(1),
  },
}));

export default function BasicTextFields() {
  const classes = useStyles();
 // const [age] = React.useState('');

/*   const currencies = [
    {
      value: '',
      label: 'Elegir...',
    },
  ]; */

  return (
    
    <form className={classes.root} noValidate autoComplete="off">
      {/* 
      <Typography variant="subtitle1" color="inherit" className="mt-8 sm:mt-16 mx-auto max-w-512">
        Ingresa los datos de cada Estudiante
			</Typography> */}
      <FormControl className={classes.formControl}>
        <InputLabel htmlFor="age-native-simple">Tipo de Documento</InputLabel>
        <Select
          native
          inputProps={{
            name: 'age',
            id: 'age-native-simple',
          }}
        >
          <option value={0} selected>Select...</option>
          <option value={1}>C.C</option>
          <option value={2}>T.I</option>
          <option value={3}>R.C</option>
        </Select>
      </FormControl>

      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Número de Documento*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start"> <Icon className="text-30" color="action">
              blur_circular
								</Icon>
          </InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Nombres*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            person
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Apellidos*</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            person_add
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Telefono</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            phone
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <InputLabel htmlFor="standard-adornment-amount">Correo Electronico</InputLabel>
        <Input
          id="standard-adornment-amount"
          startAdornment={<InputAdornment position="start">  <Icon className="text-30" color="action">
            alternate_email
								</Icon></InputAdornment>}
        />
      </FormControl>
      <FormControl fullWidth className={classes.margin}>
        <Button
          variant="contained"
          color="secondary"
          startIcon={<Icon className="text-60">people_outline</Icon>}>
          Agregar Integrantes GOES
      </Button>
      </FormControl>
    </form>
  );
}
